import React, { useState, useEffect } from "react";
import { Link, Navigate } from "react-router-dom";
import AuthService from "../services/auth.service";
import "../css/profil.css";

const UserProfile = () => {
  const [redirect, setRedirect] = useState(null);
  const [userReady, setUserReady] = useState(false);
  const [currentUser, setCurrentUser] = useState({ username: "" });
  const [name, setName] = useState("");
  const [surname, setSurname] = useState("");
  const [phoneNumber, setPhoneNumber] = useState("");

  useEffect(() => {
    const fetchCurrentUser = () => {
      const currentUser = AuthService.getCurrentUser();
      if (!currentUser) {
        setRedirect("/home");
      } else {
        setCurrentUser(currentUser);
        setUserReady(true);

        // Set name, surname, and phone number if available in the database
        setName(currentUser.name || "");
        setSurname(currentUser.surname || "");
        setPhoneNumber(currentUser.phoneNumber || "");
      }
    };

    fetchCurrentUser();

    // Clean up function to cancel any pending requests or timers
    return () => {
      // Implement any cleanup logic here if necessary
    };
  }, []);

  if (redirect) {
    return <Navigate to={redirect} />;
  }

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    if (name === "name") {
      setName(value);
    } else if (name === "surname") {
      setSurname(value);
    } else if (name === "phoneNumber") {
      setPhoneNumber(value);
    }
  };

  const saveProfile = () => {
    // You can implement the logic to save the profile here
  };

  return (
    <div className="container emp-profile">
      <form method="post">
        <div className="row">
          <div className="col-md-4">
            <div className="profile-img">
              <img
                src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS52y5aInsxSm31CvHOFHWujqUx_wWTS9iM6s7BAm21oEN_RiGoog"
                alt=""
              />
              <div className="file btn btn-lg btn-primary">
                Change Photo
                <input type="file" name="file" />
              </div>
            </div>
          </div>
          <div className="col-md-6">
            <div className="profile-head">
              <h5>{currentUser.username}</h5>
              <h6>Top Donators Rank:</h6>
              {/*
              {/* Uncomment to include 'Top Donators Rank' */}
              {/* <p className="proile-rating">
                RANKINGS : <span>8/10</span>
              </p> */}
              <ul className="nav nav-tabs" id="myTab" role="tablist">
                <li className="nav-item">
                  <a
                    className="nav-link active"
                    id="home-tab"
                    data-toggle="tab"
                    href="#home"
                    role="tab"
                    aria-controls="home"
                    aria-selected="true"
                  >
                    About
                  </a>
                </li>
                <li className="nav-item">
                  <a
                    className="nav-link"
                    id="profile-tab"
                    data-toggle="tab"
                    href="#profile"
                    role="tab"
                    aria-controls="profile"
                    aria-selected="false"
                  >
                    <Link to="/profile/edit">Edit Profile</Link>
                  </a>
                </li>
              </ul>
            </div>
          </div>
          <div className="col-md-2">
            <input
              type="submit"
              className="profile-edit-btn"
              name="btnAddMore"
              value="Donate!"
              onClick={saveProfile}
            />
          </div>
        </div>
        <div className="row">
          <div className="col-md-4">
            <div className="profile-work">
              {/* Remove 'WORK LINK' and 'SKILLS' */}
              {/* <p>WORK LINK</p>
              <a href="">Website Link</a>
              <br />
              <a href="">Bootsnipp Profile</a>
              <br />
              <a href="">Bootply Profile</a>
              <p>SKILLS</p>
              <a href="">Web Designer</a>
              <br />
              <a href="">Web Developer</a>
              <br />
              <a href="">WordPress</a>
              <br />
              <a href="">WooCommerce</a>
              <br />
              <a href="">PHP, .Net</a>
              <br /> */}
            </div>
          </div>
          <div className="col-md-8">
            <div className="tab-content profile-tab" id="myTabContent">
              <div
                className="tab-pane fade show active"
                id="home"
                role="tabpanel"
                aria-labelledby="home-tab"
              >
                <div className="row">
                  <div className="col-md-6">
                    <label>Name</label>
                  </div>
                  <div className="col-md-6">
                    {name ? (
                      <p>{name}</p>
                    ) : (
                      <input
                        type="text"
                        name="name"
                        value={name}
                        onChange={handleInputChange}
                      />
                    )}
                  </div>
                </div>
                <div className="row">
                  <div className="col-md-6">
                    <label>Surname</label>
                  </div>
                  <div className="col-md-6">
                    {surname ? (
                      <p>{surname}</p>
                    ) : (
                      <input
                        type="text"
                        name="surname"
                        value={surname}
                        onChange={handleInputChange}
                      />
                    )}
                  </div>
                </div>
                <div className="row">
                  <div className="col-md-6">
                    <label>Phone Number</label>
                  </div>
                  <div className="col-md-6">
                    {phoneNumber ? (
                      <p>{phoneNumber}</p>
                    ) : (
                      <input
                        type="text"
                        name="phoneNumber"
                        value={phoneNumber}
                        onChange={handleInputChange}
                      />
                    )}
                  </div>
                </div>
                <div className="row">
                  <div className="col-md-6">
                    <label>Username</label>
                  </div>
                  <div className="col-md-6">
                    <p>{currentUser.username}</p>
                  </div>
                </div>
                <div className="row">
                  <div className="col-md-6">
                    <label>Email</label>
                  </div>
                  <div className="col-md-6">
                    <p>{currentUser.email}</p>
                  </div>
                </div>
                {/* Add more fields for saving in the database */}
                <div className="row">
                  <div className="col-md-6">
                    <label>Token</label>
                  </div>
                  <div className="col-md-6">
                    <p>
                      {currentUser.accessToken
                        ? `${currentUser.accessToken.substring(0, 20)} ... ${
                            currentUser.accessToken.substr(
                              currentUser.accessToken.length - 20
                            )
                          }`
                        : "Access Token Not Available"}
                    </p>
                  </div>
                </div>
              </div>
              <div
                className="tab-pane fade"
                id="profile"
                role="tabpanel"
                aria-labelledby="profile-tab"
              ></div>
            </div>
          </div>
        </div>
      </form>
    </div>
  );
};

export default UserProfile;
